import React from "react";
import "bootstrap/dist/css/bootstrap.min.css";
import PrmNavBar from "./PrmNavBar";
import List from '@material-ui/core/List';
import ListItem from '@material-ui/core/ListItem';
import ListItemText from '@material-ui/core/ListItemText';
import Button from 'react-bootstrap/Button';




class ImsScripts extends React.Component {
  constructor(props) {
    super(props);
  }
    
  render() {
    return (
      <div class="prm-background">
        <PrmNavBar></PrmNavBar>
        <List >
      <ListItem>
      <Button href="#firstscript" style={{margin:10}}>Go</Button>
        <ListItemText primary="First IMS Script" secondary="script info" />
      </ListItem>

      <ListItem>
      <Button href="#firstscript" style={{margin:10}}>Go</Button>
        <ListItemText primary="ims dummy" secondary="dummy info" />
      </ListItem>

    </List>
      </div>
    );
  }
}

export default ImsScripts;
